using Moq;
using FluentAssertions;

namespace fila_no_asp_net_core_7.Tests
{
    [TestClass]
    public class TestA_HubTests
    {
        Mock<IWebHostEnvironment> _mockEnvironment;

        public TestA_HubTests()
        {
            this._mockEnvironment = new Mock<IWebHostEnvironment>();

            this._mockEnvironment
                .Setup(m => m.WebRootPath)
                .Returns(Path.Combine(AppDomain.CurrentDomain.BaseDirectory, "wwwroot"));
        }

        [TestInitialize] 
        public void Init()
        {
            //this is needed for when the tests run
            var images = Path.Combine(this._mockEnvironment.Object.WebRootPath, "Images");
            if (Directory.Exists(images) == false) Directory.CreateDirectory(images);
        }

        /// <summary>
        /// Tests the Save Hub (Prefix to Order the Execution of the Tests)
        /// </summary>
        [TestMethod]
        public void TestA_SaveHubOk()
        {
            var saveHub = new SaveHub(this._mockEnvironment.Object);

            var toBeProcessed = new List<Image>
            {
                new Image { FileName = "test.image1.jpg", Base64 = "data:image/jpeg;base64," }, 
                new Image { FileName = "test.image2.jpg", Base64 = "data:image/jpeg;base64," },
                new Image { FileName = "test.image3.jpg", Base64 = "data:image/jpeg;base64," },
                new Image { FileName = "test.image4.jpg", Base64 = "data:image/jpeg;base64," },
                new Image { FileName = "test.image5.jpg", Base64 = "data:image/jpeg;base64," },

                new Image { FileName = "test.image1.jpg", Base64 = "data:image/jpeg;base64," },
                new Image { FileName = "test.image2.jpg", Base64 = "data:image/jpeg;base64," },
                new Image { FileName = "test.image3.jpg", Base64 = "data:image/jpeg;base64," },
                new Image { FileName = "test.image4.jpg", Base64 = "data:image/jpeg;base64," },
                new Image { FileName = "test.image5.jpg", Base64 = "data:image/jpeg;base64," },
            };

            for (int i = 0; i < 100; i++)
            {
                saveHub.Process.Enqueue(new SaveRequest { RequestId = i, Images = toBeProcessed });
            }

            saveHub.ProcessQueue().GetAwaiter().GetResult();

            var done = this.NumberOfProcessedElementsToExpect<SaveRequest, SaveResponse>(saveHub, 100);
            var task = Task.WhenAny(done, Task.Delay(5000));

            task.Result.Id.Should().Be(done.Id);
            saveHub.Processed.Count(x => x.Status == "Saved").Should().Be(100);
        }

        /// <summary>
        /// Tests the Save Hub (Prefix to Order the Execution of the Tests)
        /// </summary>
        [TestMethod]
        public void TestB_SaveHubError()
        {
            var saveHub = new SaveHub(this._mockEnvironment.Object);

            var toBeProcessed = new List<Image>
            {
                new Image { FileName = "test.image1.jpg", Base64 = "*** Invalid Base64 String Image ***" },
            };

            for (int i = 0; i < 100; i++)
            {
                saveHub.Process.Enqueue(new SaveRequest { RequestId = i, Images = toBeProcessed });
            }

            saveHub.ProcessQueue().GetAwaiter().GetResult();

            var done = this.NumberOfProcessedElementsToExpect<SaveRequest, SaveResponse>(saveHub, 100);
            var task = Task.WhenAny(done, Task.Delay(5000));

            task.Result.Id.Should().Be(done.Id);
            saveHub.Processed.Count(x => x.Status == "Failed").Should().Be(100);
        }

        /// <summary>
        /// Tests the Process Hub (Prefix to Order the Execution of the Tests)
        /// </summary>
        [TestMethod]
        public void TestC_ProcessHubOk()
        {
            var processHub = new ProcessHub(this._mockEnvironment.Object);

            var toBeProcessed = new List<string>
            {
                "test.image1.jpg",
                "test.image2.jpg",
                "test.image3.jpg",
                "test.image4.jpg",
                "test.image5.jpg",
            };

            for (int i = 0; i < 100; i++)
            {
                processHub.Process.Enqueue(new ProcessRequest { RequestId = i, FileNames = toBeProcessed });
            }

            processHub.ProcessQueue().GetAwaiter().GetResult();

            var done = this.NumberOfProcessedElementsToExpect<ProcessRequest, ProcessResponse>(processHub, 100);
            var task = Task.WhenAny(done, Task.Delay(5000));

            task.Result.Id.Should().Be(done.Id);
            processHub.Processed.Count().Should().Be(100);
        }

        private Task NumberOfProcessedElementsToExpect<TProcess, TProcessed>(Hub<TProcess, TProcessed> hub, int numberOfProcessedElements)
            where TProcess: IRequestId
            where TProcessed : IRequestId
        {
            if (hub.IsProcessing)
            {
                while (hub.Processed.Count != numberOfProcessedElements) { }
            }

            return Task.CompletedTask;
        }
    }
}